import React from "react";
import Link from "next/link";

const Index = () => (
    <div>
        <Link href="/login">
            <button type="button" className="btn btn-primary">Login</button>

        </Link>
        <h1>Suppose to be our landing :)</h1>
    </div>
);

export default Index;
